import React, { Component } from "react";

class Login extends Component {

	render() {
		return (
			< div >
				console.log("Hello")
			<button
					onClick={() => this.props.test}
					className="btn btn-seconday btn-sm"
				>
					Login
			</button>
			</div >
		);
	}
}

export default Login;
